import styles from './Modal.module.css'

const Modal = ({ setIsOpen }) => {
    return (
        <Modal
            onClick={() => setIsOpen(false)}
            // onClose={handleClose}
            aria-labelledby="modal-modal-title"
            aria-describedby="modal-modal-description"
        >
            <h4>MODAL DE TESTE</h4>
        </Modal>
    )
}

export default Modal
